import React, { Component } from 'react';
import { AlertContainer } from "react-bs-notifier";
const alerts = [{
	id: 1,
	type: "info",
	message: "Hello, world"
}, {
	id: 2,
	type: "success",
	message: "Oh, hai"
}]
class Notify extends Component {
    render() {
        return (
            <AlertContainer alerts={alerts} />
        );
    }
}

export default Notify;
